import React from "react";
import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

export default function Expenses(props) {
  return (
    <div className="expenses">
      {props.expenses.map((item, i) => {
        return (
          <ExpenseItem
            date={item.date}
            amount={item.amount}
            title={item.title}
          />
        );
      })}
    </div>
  );
}
